class NIK {
    constructor(nik) {
        if (typeof nik != "string") {
            throw new TypeError("Input type should be string");
        } else if (nik.length != 16) {
            throw "InvalidNIK: NIK should be 16 characters length";
        } else if (isNaN(parseInt(nik.slice(6,12)))) {
            throw "InvalidNIK: Invalid birth date";
        } else {
            let dateBirthInt = parseInt(nik.slice(6,8));
            let monthBirthInt = parseInt(nik.slice(8,10));
            let yearBirthInt = parseInt(nik.slice(10,12));
            if (!((dateBirthInt >= 1 && dateBirthInt <= 31) || (dateBirthInt >= 41 && dateBirthInt <= 71))) {
                throw "InvalidNIK: Invalid birth date";
            } else if (monthBirthInt < 1 || monthBirthInt > 12) {
                throw "InvalidNIK: Invalid birth month";
            } else {
                this.bulan_lahir = monthBirthInt;
                this.tahun_lahir = yearBirthInt;
                let provIdx, kabkotaIdx, kecamatanIdx;
                let provinsiObj, kabkotaObj, kecamatanObj;
                for (provIdx in KodeNIk.data) {
                    provinsiObj = KodeNIk.data[provIdx];
                    if (provinsiObj.kode_provinsi == nik.slice(0,2)) {
                        this.provinsi = provinsiObj.nama_provinsi;
                        for (kabkotaIdx in provinsiObj.kabkota) {
                            kabkotaObj = provinsiObj.kabkota[kabkotaIdx]; 
                            if (kabkotaObj.kode_kabkota == nik.slice(2,4)) {
                                this.kabkota = kabkotaObj.nama_kabkota;
                                for (kecamatanIdx in kabkotaObj.kecamatan) {
                                    kecamatanObj = kabkotaObj.kecamatan[kecamatanIdx];
                                    if (kecamatanObj.kode_kecamatan == nik.slice(4,6)) {
                                        this.kecamatan = kecamatanObj.nama_kecamatan;
                                        break;
                                    }
                                }
                                if (this.kecamatan == null) throw "InvalidNIK: No Kecamatan found";
                                else break;
                            }
                        }
                        if (this.kabkota == null) throw "InvalidNIK: No Kota/Kabupaten found";
                        else break;
                    }
                }
                if (this.provinsi == null) throw "InvalidNIK: No Provinsi found";
                if (dateBirthInt > 40) {
                    this.tanggal_lahir = dateBirthInt - 40;
                    this.jenis_kelamin = "Perempuan";
                } else {
                    this.tanggal_lahir = dateBirthInt;
                    this.jenis_kelamin = "Laki - laki";
                }
                this.kode_unik = nik.slice(12,16);
            }
        }
    }
}

